    <title>All Unique Key Ids</title>
  </head>
  <body>
    <button class="logout">
      <a href="Login" style="color: rgb(126, 104, 104); text-decoration: none"
        >Logout</a
      >
    </button>
    <div class="w3-row w3-container">
      <table
        class="table table-striped"
        style="
          border: 1px solid black;
          background-color: azure;
          margin-left: auto;
          align-self: center;
          margin-right: auto;
          padding: 60px 60px 60px 60px;
          margin-top: 10px !important;
        "
      >
        <thead>
          <tr style="align-items: center">
            <th>UNIQUE ID's&nbsp;&nbsp;&nbsp;<w</th>
            &nbsp;&nbsp;
            <th>DATES&nbsp;&nbsp;&nbsp;</th>
            &nbsp;
          </tr>
          
        </thead>
        <tbody>
          {% for x in data %}
          <tr>
            <td>{{x.id}}&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>
            <td>{{x.date}}&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</td>
            
          </tr>
          {% endfor %}
        </tbody>
      </table>
    </div>
  </body>
